import Styles from './Card.module.css';

export default function Card({ id, name, species,
                               genre, image, onClose }) {
   return (
      <div className={Styles.card}>
         <button
           className={Styles.btn}
           onClick={onClose}
         >X</button>
         <h2>{name}</h2>
         <h2>{species}</h2>
         <h2>{genre}</h2>
        <img src={image} alt="name" className={Styles.btn} />
      </div>
   );
}
